import React from 'react';
import { Link, Outlet,useParams, useSearchParams } from 'react-router-dom';

function Products(props) {


    const [filter, setFilter] = useSearchParams();


   let params =  useParams();
   console.log("params",params)
   let proId = params.rootId; 
//    console.log(proId);
    return (
        <div>
            <h2>Products id: {proId}</h2>
            <Link to="topproducts">Top Products</Link>
            <Link to="featuredproduct">Feature Product</Link>
            <Outlet />

            <Button onClick={()=> setFilter({filter:'active'})} >Serach filter</Button>
            <Button onClick={()=> setFilter(null)} >Reset Filter</Button>
        </div>
    );
}

export default Products;
